import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './screens/Home';

import './App.css';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <div>
          <Routes>
            <Route exact path="/" element={<Home/>}/>

          </Routes>
        </div>
      </Router>
    </>
  );
}

export default App;
